import { useState } from "react"

export default function WithCouhnter(){
    const Newcomponenet =()=>{
        const [count , setcount]=useState(0)
        const increment=(e)=>{
            e.preventDefault()
            setCount(prevent => prevent + 1)
        }

        return(
            <>
               <div className="container text-center mt-4">
            <button className="btn btn-primary m-2">{count}</button>
            <button 
                type="button" 
                className="btn btn-secondary m-2"
                onMouseOver={increment}
            >
                Hover to Increment
            </button>
        </div>
            </>
        )
    }
    return <Newcomponenet />
   

}
